import React from 'react';
import Lightbox from 'react-images';
// import slide from "./slide.css";

function Multi() {

     let settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        cssEase: "linear"
    }


  return (
     <Lightbox  {...settings}>
      <div className="Wrap">
                <img src="/images/disney.jpg" alt="project" />
          </div>
           <div className="Wrap">
                <img src="/images/disney.jpg" alt="project" />
          </div>
           <div className="Wrap">
                <img src="/images/disney.jpg" alt="project" />
          </div>
    </Lightbox >
  )
}

export default Multi;
